Заказывайте лекарства, витамины и БАД, товары для мам и детей, средства гигиены, лечебную косметику и зоотовары в приложении онлайн-аптеки ЕАПТЕКА.

Качество товаров гарантировано. Все товары сертифицированы, строго соблюдаются условия хранения и транспортировки, в том числе для термолабильных препаратов (требующих хранения в холодильнике).

В каталоге представлены разные товарные позиции:
- витамины;
- БАД;
- широкий спектр лекарственных препаратов;
- лечебная косметика;
- гигиенические товары;
- продукция для детей, беременных и кормящих;
- зоотовары.

Установите приложение и первыми узнавайте о наличии лекарств, акциях и выгодных предложениях. Заказывайте в любое время: чат с фармацевтом и оформление заказов работают круглосуточно.

Приложение ЕАПТЕКА: просто, удобно, выгодно.
- Скидки и акции на лекарства, медицинские товары и косметику;
- Удобный поиск: голосом, по штрихкоду, активному веществу или торговому наименованию препарата;
- Один логин для сайта и мобильного приложения: доступ в «Избранное», к истории покупок и статусу заказов с любого устройства;
- Подробные инструкции к препаратам;
- Уведомления об изменении статуса заказа;
- Возможность онлайн оплаты картой, а также оплата через Apple Pay и SberPay

ЕАПТЕКА: быстро, надежно, всегда рядом.
- Более 70 000 товаров для красоты и здоровья – самый широкий ассортимент на рынке;
- Более 1 000 пунктов самовывоза;
- Аптечная лицензия № ЛО-82-02-000978 от 09 декабря 2020 г.;
- Разрешение на осуществление розничной торговли лекарственными препаратами для медицинского применения дистанционным способом № ДТ-77-000252 от 11.11.2020 г.

